import { Link } from "react-router-dom";

const MainPage = () => {
    return (
        <body >
        <div>
            <ul>
                <li><Link to="/pathfinder">Click to redirect Pathfinder</Link></li>
                <li><Link to="/pathdragon">Click to redirect PathDragon</Link></li>
                <li>Hello</li>
            </ul>
        </div>
        </body>
    )
};

export default MainPage;
